column8:
　1982年に登場したランニングモデル「420」のスリム＆ロープロファイルなスタイルをスエード/テキスタイルアッパーで提案する女性用モデル。ニューバランスの定番カラーにホワイト「N」が映える2色で展開。 <br>

■カラー：CRB(BLACK/GRAY)<br>

■サイズ：22～25cm(0.5cm刻み)<br>

■足幅：B<br>
<br>
<br>
検索ワード：カジュアルシューズ ハイキング アウトドア キャンプ トレッキング シューズ 靴<style TYPE="text/css">

