好きなお花を好きな色で世界でひとつだけのプリザーブドフラワーを作ってみませんか！<br>
プリザーブドフラワーがご自分で作れます。<br><br>

◆容量：500ml<br>
◆素材：アルコール類、グリコール類、染料<br>
